import React from 'react';

const Register = () => {
   return (
      <div>
         <form onSubmit={submitHandler}>
            <h5>Register</h5>
            name:<input type="text" value={name} onChange={event => setName(event.target.value)}/><br/>
            email:<input type="text" value={email} onChange={event => setName(event.target.value)}/><br/>
            username:<input type="text" value={username} onChange={event => setName(event.target.value)}/><br/>

         </form>
      </div>
   )
}

export default Register;
